local function getDistance(pos1, pos2)
	return math.max(math.abs(pos1.x - pos2.x), math.abs(pos1.y - pos2.y))
end

local ORIGINAL_FLOOR_CHANGE_POS = FLOOR_CHANGE_POS

local function filterNearbyPositions(positions)
	if not positions then
		return {}
	end

	local filtered = {}

	for _, pos1 in ipairs(positions) do
		local shouldAdd = true

		for _, pos2 in ipairs(filtered) do
			if pos1.direction == pos2.direction and getDistance(pos1.pos, pos2.pos) <= 2 then
				shouldAdd = false

				break
			end
		end

		if shouldAdd then
			table.insert(filtered, pos1)
		end
	end

	return filtered
end

FLOOR_CHANGE_POS = {}

local totalOriginal = 0
local totalFiltered = 0

for z, positions in pairs(ORIGINAL_FLOOR_CHANGE_POS) do
	totalOriginal = totalOriginal + #positions
	FLOOR_CHANGE_POS[z] = filterNearbyPositions(positions)
	totalFiltered = totalFiltered + #FLOOR_CHANGE_POS[z]
end

ORIGINAL_FLOOR_CHANGE_POS = nil
